<?phpdeclare(strict_types=1);namespace Test\Functional\V1\Auth\Change\Email;use Test\Functional\WebTestCase;class ConfirmTest extends WebTestCase{    protected function setUp(): void    {        parent::setUp();        $this->loadFixtures([            ConfirmFixtures::class        ]);    }    public function testMethod(): void    {        $response = $this->app()->handle(self::json('GET', '/v1/change/email/confirm', []));        self::assertEquals(405, $response->getStatusCode());    }}